import '../App.css';

function Popup (props) {
    return(props.trigger) ? (
        <div className="popup">
            <div className="popup-inner">
                <button className="close-btn">Cerrar</button>
                {props.children}
            </div>

        </div>
    ) : "";
};

export default Popup
